import React, { useState } from "react";
import { useDispatch } from "react-redux";
import { useNavigate } from "react-router-dom";
import { add } from "../features/Servicios/ServicioSlice";
import Estado from "./Estado";
import "./addservice.css";

export default function AddService() {
  const dispatch = useDispatch();
  const [ServiceDato, setServiceDato] = useState({
    id: "",
    diagnostico: "",
    estado: "",
  });
  const Navigate = useNavigate();
  const DatosXguardar = (e) => {
    console.log(e.target.name, e.target.value);
    setServiceDato({ ...ServiceDato, [e.target.name]: e.target.value });
  };
  return (
    <div>
      <div className="login-box">
        <h2> Agregar Nuevo</h2>
        <form>
          <div className="user-box">
            <label>ingresar id:</label>
            <input name="id" type="text" onChange={DatosXguardar} />
          </div>
          <div className="user-box">
            <label>Escoger estado:</label>
            <select name="estado" id="estado" onChange={DatosXguardar}>
              <option></option>
              <Estado />
            </select>
          </div>
          <div className="user-box">
            <label>Diagnostico:</label>
            <input name="diagnostico" type="text" onChange={DatosXguardar} />
          </div>
          {/* <button
            onClick={(e) => {
              e.preventDefault();
              dispatch(add(ServiceDato));
              Navigate("/");
            }}
          >
            Agregar
          </button> */}

          <a
            onClick={(e) => {
              e.preventDefault();
              dispatch(add(ServiceDato));
              Navigate("/");
            }}
          >
            <span></span>
            <span></span>
            <span></span>
            <span></span>
            Agregar
          </a>
        </form>
      </div>
    </div>
  );
}
